import React from 'react'
import { getAllUser } from '../api/user'

const AllUsers = () => {
    return null

    async function _getAllUser(id: number){
      const data = await getPost(id);
      convertToFormData(data)
    }

    useEffect(() => {
      // chaque fois que l'id change
      _getPosts(Number(id));
    }, [id]);
}

export default AllUsers
